import "./App.css";
// import { styled } from "@mui/material/styles";
import {
  List,
  ListItem,
  ListItemButton,
  ListItemIcon,
  ListItemText,
  Box,
  Typography,
} from "@mui/material";
import InboxIcon from "@mui/icons-material/Inbox";
import LunchDiningIcon from "@mui/icons-material/LunchDining";
const mockLunch = [
  { name: "lunch1", vote: 0 },
  { name: "lunch2", vote: 0 },
  { name: "lunch3", vote: 0 },
  { name: "lunch4", vote: 0 },
  { name: "lunch5", vote: 0 },
];
function Lunch() {
  return (
    <>
      <Box padding={4}>
        <Box padding={2}>
          <Typography variant="h6">Events this week</Typography>
        </Box>
        <List>
          {mockLunch.map((lunch) => (
            <ListItem disablePadding>
              <ListItemButton>
                <ListItemIcon>
                  <LunchDiningIcon />
                </ListItemIcon>
                <ListItemText primary={lunch.name} />
              </ListItemButton>
            </ListItem>
          ))}
        </List>
      </Box>
    </>
  );
}

export default Lunch;
